import React from 'react';
import { makeStyles, withStyles } from '@material-ui/core/styles';

import CssBaseline from '@material-ui/core/CssBaseline';
import Grid from '@material-ui/core/Grid';
import Typography from '@material-ui/core/Typography';
import Container from '@material-ui/core/Container';
import Paper from '@material-ui/core/Paper';
import Main from '../../Components/Main/Main';
import Stepper from '../../Components/Stepper/Stepper';
import TextField from '@material-ui/core/TextField';
import Button from '@material-ui/core/Button';

const useStyles = makeStyles((theme) => ({
    root: {
        width: '100%',
    },
    button: {
        marginRight: theme.spacing(1),
        marginBottom: theme.spacing(6),
    },
    buttons: {
        display: 'flex',
        justifyContent: 'flex-end',
    },
}));

function Register() {
    const classes = useStyles();

    return (
        <Main >
            <Grid className={classes.root}>
                <Grid item xs>
                    <Typography variant="h5" component="h2">
                        Register
                    </Typography>
                </Grid>
                <form>
                <Grid item xs>
                    <TextField label="Username" fullWidth type="text" variant="outlined" />
                </Grid>
                <Grid item xs>
                    <TextField label="Password" fullWidth type="password" variant="outlined" />
                </Grid>
                </form>
                <Grid item xs className={classes.buttons}>
                    <Button className={classes.mar}>Back</Button>
                    <Button variant="contained" color="primary" className={classes.button}>Next</Button>
                </Grid>
            </Grid>







        </Main>
    );
}

export default Register;
